        #region 塔
        public static MeshGeometry3D genTowerMesh(Point3D p0, Point3D p1, Point3D p2, Point3D p3, Point3D p4, int towertype)  //塔
        {// towertype 0, 返回整个塔，1, 返回塔体, 2, 返回四方形底面;  p0为顶点
            MeshGeometry3D mesh = new MeshGeometry3D();
            mesh.Positions.Add(p0);
            mesh.Positions.Add(p1);
            mesh.Positions.Add(p2);
            mesh.Positions.Add(p3);
            mesh.Positions.Add(p4);

            if (towertype == 0 || towertype == 1)
            {
                mesh.TextureCoordinates.Add(new Point(0.5, 0));
                mesh.TextureCoordinates.Add(new Point(0, 1));
                mesh.TextureCoordinates.Add(new Point(0.25, 1));
                mesh.TextureCoordinates.Add(new Point(0.5, 1));
                mesh.TextureCoordinates.Add(new Point(0.75, 1));
                mesh.TriangleIndices.Add(1);
                mesh.TriangleIndices.Add(0);
                mesh.TriangleIndices.Add(2);
                mesh.TriangleIndices.Add(2);
                mesh.TriangleIndices.Add(0);
                mesh.TriangleIndices.Add(3);
                mesh.TriangleIndices.Add(3);
                mesh.TriangleIndices.Add(0);
                mesh.TriangleIndices.Add(4);
                mesh.TriangleIndices.Add(4);
                mesh.TriangleIndices.Add(0);
                mesh.TriangleIndices.Add(1);
            }
            if (towertype == 0 || towertype == 2)
            {
                mesh.TextureCoordinates.Add(new Point(0.5, 0));
                mesh.TextureCoordinates.Add(new Point(0, 1));
                mesh.TextureCoordinates.Add(new Point(1, 1));
                mesh.TextureCoordinates.Add(new Point(1, 0));
                mesh.TextureCoordinates.Add(new Point(0, 0));
                mesh.TriangleIndices.Add(1);
                mesh.TriangleIndices.Add(2);
                mesh.TriangleIndices.Add(3);
                mesh.TriangleIndices.Add(3);
                mesh.TriangleIndices.Add(4);
                mesh.TriangleIndices.Add(1);
            }

            return mesh;
        }


