        #region 可分离正斜圆锥
        public static MeshGeometry3D genCone3DMesh(Point3D pTop, Point3D pButtom, double tRadius, double bRadius)  //无顶面
        {
            int tDiv = 32;
            int yDiv = 32;
            double maxTheta = DegToRad(360.0);
            double minY = pTop.Y;// -1.0;
            double maxY = pButtom.Y;// 1.0;
            Point3D pCenter;
            double rad;

            double dt = maxTheta / tDiv;
            double dy = (maxY - minY) / yDiv;

            MeshGeometry3D mesh = new MeshGeometry3D();
            int yi;
            double x, y, z;
            for (yi = 0; yi <= yDiv; yi++)
            {
                y = minY + yi * dy;

                x = (pTop.X - pButtom.X) / (pTop.Y - pButtom.Y) * (y - pButtom.Y) + pButtom.X;
                z = (pTop.Z - pButtom.Z) / (pTop.Y - pButtom.Y) * (y - pButtom.Y) + pButtom.Z;
                pCenter = new Point3D(x, y, z);
                rad = tRadius + (bRadius - tRadius) * yi / yDiv;

                for (int ti = 0; ti <= tDiv; ti++)
                {
                    double t = ti * dt;

                    mesh.Positions.Add(GetPosition(t, pCenter, rad));
                    //mesh.Normals.Add(GetNormal(t, pCenter,rad));
                    mesh.TextureCoordinates.Add(GetTextureCoordinate(t, y, pTop.Y - pButtom.Y));
                }
            }

            for (yi = 0; yi < yDiv; yi++)
            {
                for (int ti = 0; ti < tDiv; ti++)
                {
                    int x0 = ti;
                    int x1 = (ti + 1);
                    int y0 = yi * (tDiv + 1);
                    int y1 = (yi + 1) * (tDiv + 1);

                    mesh.TriangleIndices.Add(x0 + y0);
                    mesh.TriangleIndices.Add(x1 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);

                    mesh.TriangleIndices.Add(x1 + y0);
                    mesh.TriangleIndices.Add(x1 + y1);
                    mesh.TriangleIndices.Add(x0 + y1);
                }
            }
            //上封闭
            yi = 0;
            y = minY + yi * dy;
            x = (pTop.X - pButtom.X) / (pTop.Y - pButtom.Y) * (y - pButtom.Y) + pButtom.X;
            z = (pTop.Z - pButtom.Z) / (pTop.Y - pButtom.Y) * (y - pButtom.Y) + pButtom.Z;
            pCenter = new Point3D(x, y, z);
            rad = tRadius + (bRadius - tRadius) * yi / yDiv;

            for (int ti = 0; ti <= tDiv; ti++)
            {
                double t = ti * dt;
                mesh.Positions.Add(GetPosition(t, pCenter, rad));
                //mesh.Normals.Add(GetNormal(t, pCenter,rad));
                mesh.TextureCoordinates.Add(GetTextureCoordinate(t, y, pTop.Y - pButtom.Y));
            }

            int zz = (yDiv + 1) * (tDiv + 1);
            for (int ti = 1; ti < tDiv; ti++)
            {
                int x0 = zz + ti - 1;
                int x1 = zz + ti;
                mesh.TriangleIndices.Add(zz);
                mesh.TriangleIndices.Add(x1);
                mesh.TriangleIndices.Add(x0);

            }
            
            //下封闭
            yi = yDiv;
            y = minY + yi * dy;
            x = (pTop.X - pButtom.X) / (pTop.Y - pButtom.Y) * (y - pButtom.Y) + pButtom.X;
            z = (pTop.Z - pButtom.Z) / (pTop.Y - pButtom.Y) * (y - pButtom.Y) + pButtom.Z;
            pCenter = new Point3D(x, y, z);
            rad = tRadius + (bRadius - tRadius) * yi / yDiv;

            for (int ti = 0; ti <= tDiv; ti++)
            {
                double t = ti * dt;
                mesh.Positions.Add(GetPosition(t, pCenter, rad));
                //mesh.Normals.Add(GetNormal(t, pCenter,rad));
                mesh.TextureCoordinates.Add(GetTextureCoordinate(t, y, pTop.Y - pButtom.Y));
            }

            zz = (yDiv + 1+1) * (tDiv + 1);
            for (int ti = 1; ti < tDiv; ti++)
            {
                int x0 = zz + ti - 1;
                int x1 = zz + ti;
                mesh.TriangleIndices.Add(zz);
                mesh.TriangleIndices.Add(x0);
                mesh.TriangleIndices.Add(x1);

            }
            



            mesh.Freeze();
            return mesh;

        }
        internal static Point3D GetPosition(double t, Point3D pCenter, double r)
        {
            double x = r * Math.Cos(t);
            double z = r * Math.Sin(t);

            return new Point3D(pCenter.X + x, pCenter.Y, pCenter.Z + z);
        }

        private static Vector3D GetNormal(double t, Point3D pTop, Point3D pButtom, double r)
        {
            // 备忘：求Y向量
            double x = r * Math.Cos(t);
            double z = r * Math.Sin(t);
            //double y = 1;
            return new Vector3D(x, 1, z);
        }
        private static Point GetTextureCoordinate(double t, double y, double height)
        {
            Matrix m = new Matrix();
            m.Scale(1 / (2 * Math.PI), -1.0 / height);

            Point p = new Point(t, y);
            p = p * m;

            return p;
        }

