        public static MeshGeometry3D genCylinder3DMesh()  //有顶面
        {
            int tDiv = 32;
            int yDiv = 1;
            double maxTheta = DegToRad(360.0);
            double minY = -1.0;
            double maxY = 1.0;

            double dt = maxTheta / tDiv;
            double dy = (maxY - minY) / yDiv;

            MeshGeometry3D mesh = new MeshGeometry3D();

            for (int yi = 0; yi <= yDiv; yi++)
            {
                double y = minY + yi * dy;

                for (int ti = 0; ti <= tDiv; ti++)
                {
                    double t = ti * dt;

                    mesh.Positions.Add(GetPosition(t, y));
                    mesh.Normals.Add(GetNormal(t, y));
                    mesh.TextureCoordinates.Add(GetTextureCoordinate(t, y));
                }
            }

            for (int yi = 0; yi < yDiv; yi++)
            {
                for (int ti = 0; ti < tDiv; ti++)
                {
                    int x0 = ti;
                    int x1 = (ti + 1);
                    int y0 = yi * (tDiv + 1);
                    int y1 = (yi + 1) * (tDiv + 1);

                    mesh.TriangleIndices.Add(x0 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y0);

                    mesh.TriangleIndices.Add(x1 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y1);
                }
            }

            //======== 下封顶
            mesh.Positions.Add(new Point3D(0, -1, 0));
            mesh.Normals.Add(new Vector3D(0, -20, 0));
            mesh.TextureCoordinates.Add(GetTextureCoordinate(0, -1));

            for (int ti = 0; ti <= tDiv; ti++)
            {
                double t = ti * dt;

                mesh.Positions.Add(GetPosition(t, -1));
                mesh.Normals.Add(GetNormal2(t, -20));
                mesh.TextureCoordinates.Add(GetTextureCoordinate(t, -1));
            }
            for (int ti = 0; ti < tDiv; ti++)
            {
                int zz = (yDiv + 1) * (tDiv + 1);
                int x0 = zz + ti + 1;
                int x1 = zz + (ti + 1) + 1;
                mesh.TriangleIndices.Add(x0);
                mesh.TriangleIndices.Add(x1);
                mesh.TriangleIndices.Add(zz);
            }

            //==上封顶
            mesh.Positions.Add(new Point3D(0, 1, 0));
            mesh.Normals.Add(new Vector3D(0, 20, 0));
            mesh.TextureCoordinates.Add(GetTextureCoordinate(0, 1));

            for (int ti = 0; ti <= tDiv; ti++)
            {
                double t = ti * dt;

                mesh.Positions.Add(GetPosition(t, 1));
                mesh.Normals.Add(GetNormal2(t, 20));
                mesh.TextureCoordinates.Add(GetTextureCoordinate(t, 1));
            }
            for (int ti = 0; ti < tDiv; ti++)
            {
                int zz = (yDiv + 1) * (tDiv + 1) + 1 + tDiv + 1;
                int x0 = zz + ti + 1;
                int x1 = zz + (ti + 1) + 1;
                mesh.TriangleIndices.Add(zz);
                mesh.TriangleIndices.Add(x1);
                mesh.TriangleIndices.Add(x0);
            }


            mesh.Freeze();
            return mesh;
        }
        public static MeshGeometry3D genCylinder3DMainMesh()  //无顶面的柱体, 用于组合带字圆柱
        {
            int tDiv = 32;
            int yDiv = 32;
            double maxTheta = DegToRad(360.0);
            double minY = -1.0;
            double maxY = 1.0;

            double dt = maxTheta / tDiv;
            double dy = (maxY - minY) / yDiv;

            MeshGeometry3D mesh = new MeshGeometry3D();

            for (int yi = 0; yi <= yDiv; yi++)
            {
                double y = minY + yi * dy;

                for (int ti = 0; ti <= tDiv; ti++)
                {
                    double t = ti * dt - Math.PI / 2;

                    mesh.Positions.Add(GetPosition(t, y));
                    mesh.Normals.Add(GetNormal(t, y));
                    mesh.TextureCoordinates.Add(GetTextureCoordinate(t, y));
                }
            }

            for (int yi = 0; yi < yDiv; yi++)
            {
                for (int ti = 0; ti < tDiv; ti++)
                {
                    int x0 = ti;
                    int x1 = (ti + 1);
                    int y0 = yi * (tDiv + 1);
                    int y1 = (yi + 1) * (tDiv + 1);

                    mesh.TriangleIndices.Add(x0 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y0);

                    mesh.TriangleIndices.Add(x1 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y1);
                }
            }

            mesh.Freeze();
            return mesh;
        }
