        internal static Point3D GetPosition(double t, double y)
        {
            double x = Math.Cos(t);
            double z = Math.Sin(t);

            return new Point3D(x, y, z);
        }

        internal static Vector3D GetNormal(double t, double y)
        {
            double x = Math.Cos(t);
            double z = Math.Sin(t);

            return new Vector3D(x, 0, z);
        }
        internal static Vector3D GetNormal2(double t, double y)
        {
            double x = Math.Cos(t);
            double z = Math.Sin(t);

            return new Vector3D(x, y, z);
        }


        internal static Point GetTextureCoordinate(double t, double y)
        {
            Matrix m = new Matrix();
            m.Scale(1 / (2 * Math.PI), -0.5);

            Point p = new Point(t, y);
            p = p * m;

            //return p;
            return new Point(1 - p.X, p.Y);
        }
        internal static Point GetTextureCoordinate2(double t, double y)
        {
            //Matrix m = new Matrix();
            //m.Scale(1 / (2 * Math.PI), -0.5);
            //Point p = new Point(t, y);
            //p = p * m;
            Point p = new Point();
            p.X = Math.Cos(t);
            p.Y = Math.Sin(t);


            return p;
        }

        internal static double DegToRad(double degrees)
        {
            return (degrees / 180.0) * Math.PI;
        }
