        public static MeshGeometry3D genSphereMesh(double start, double end)
        {
            int tDiv = 64;
            int yDiv = 64;
            double maxTheta = DegToRad(360.0);
            double minY = -1.0;
            double maxY = 1.0;

            double dt = maxTheta / tDiv;
            double dy = (maxY - minY) / yDiv;

            int sDiv = (int)(yDiv * start);
            int eDiv = (int)(yDiv * end);

            yDiv = eDiv - sDiv;

            MeshGeometry3D mesh = new MeshGeometry3D();

            for (int yi = sDiv; yi <= eDiv; yi++)
            {
                double y = minY + yi * dy;

                for (int ti = 0; ti <= tDiv; ti++)
                {
                    double t = ti * dt;

                    mesh.Positions.Add(SphereGetPosition(t, y));
                    mesh.Normals.Add(SphereGetNormal(t, y));
                    mesh.TextureCoordinates.Add(SphereGetTextureCoordinate(t, y));
                }
            }

            for (int yi = 0; yi < yDiv; yi++)
            {
                for (int ti = 0; ti < tDiv; ti++)
                {
                    int x0 = ti;
                    int x1 = (ti + 1);
                    int y0 = yi * (tDiv + 1);
                    int y1 = (yi + 1) * (tDiv + 1);

                    mesh.TriangleIndices.Add(x0 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y0);

                    mesh.TriangleIndices.Add(x1 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y1);
                }
            }
            if (start > 0 && end < 1)
            {
                // 上封顶
                double y2 = minY + eDiv * dy;

                for (int ti = 0; ti <= tDiv; ti++)
                {
                    double t = ti * dt;

                    mesh.Positions.Add(SphereGetPosition(t, y2));
                    mesh.Normals.Add(new Vector3D(0, 1, 0));
                    mesh.TextureCoordinates.Add(SphereGetTextureCoordinate(t, y2));
                }
                int zz = (yDiv + 1) * (tDiv + 1);
                for (int ti = 1; ti < tDiv; ti++)
                {
                    int x0 = zz + ti - 1;
                    int x1 = zz + ti;
                    mesh.TriangleIndices.Add(zz);
                    mesh.TriangleIndices.Add(x1);
                    mesh.TriangleIndices.Add(x0);

                }

                /*
                // 下封顶
                y2 = minY + sDiv * dy;

                for (int ti = 0; ti <= tDiv; ti++)
                {
                    double t = ti * dt;

                    mesh.Positions.Add(SphereGetPosition(t, y2));
                    mesh.Normals.Add(new Vector3D(0, -1, 0));
                    mesh.TextureCoordinates.Add(SphereGetTextureCoordinate(t, y2));
                }
                zz = (yDiv + 2) * (tDiv + 1);
                for (int ti = 1; ti < tDiv; ti++)
                {
                    int x0 = zz + ti - 1;
