            if (mesh.Bounds.SizeY > 0.5)
                vecscale = new Vector3D(panelHeight / 2 * w / h, panelHeight / 2, 1);
            else
                vecscale = new Vector3D(panelHeight / 2 * w / h, 1, panelHeight / 2);
            Point3D pcenter = new Point3D(mesh.Bounds.X + mesh.Bounds.SizeX * controlHAlign, mesh.Bounds.Y + mesh.Bounds.SizeY * controlVAlign, mesh.Bounds.Z + mesh.Bounds.SizeZ * controlVAlign);


