        /// <summary>
        /// 返回带文字的GeometryModel3D，保持mesh大小，文字居中，若backgroud为透明适用于附着于其它模型平面的文字，或直接做为一个模型组成部分
        /// </summary>
        /// <param name="mesh">模型的MeshGeometry3D</param>
        /// <param name="backgroudbrush">背景brush</param>
        /// <param name="txtbrush">文字brush</param>
        /// <param name="fontsize">控制清晰度</param>
        /// <param name="text">文字</param>
        /// <param name="aspect">最终呈现的宽与高的比例</param>
        /// <param name="isrotation">文字是否旋转90度</param>
        /// <param name="margin">文字前后留空的比例，以fontsize为基准</param>
        /// <returns></returns>
        public static GeometryModel3D genTextPanel2(MeshGeometry3D mesh, Brush backgroudbrush, Brush txtbrush, double fontsize, string text, double aspect, bool isrotation, Thickness margin)
        {
            int w = 0, h = 0;
            TextBlock txt = new TextBlock();
            txt.FontSize = fontsize;
            txt.Foreground = txtbrush;
            txt.HorizontalAlignment = HorizontalAlignment.Center;
            txt.VerticalAlignment = VerticalAlignment.Center;
            txt.Text = text;
            txt.Measure(new Size(Double.PositiveInfinity, Double.PositiveInfinity));
            double tw, th;
            if (isrotation)
            {
                txt.RenderTransformOrigin = new Point(0.5, 0.5);
                txt.LayoutTransform = new RotateTransform(90);
                th = Math.Ceiling(txt.DesiredSize.Width);
                tw = Math.Ceiling(txt.DesiredSize.Height);
            }
            else
            {
                tw = Math.Ceiling(txt.DesiredSize.Width);
                th = Math.Ceiling(txt.DesiredSize.Height);
            }
            tw = tw + fontsize * (margin.Left + margin.Right);
            th = th + fontsize * (margin.Top + margin.Bottom);

            if (aspect < 0.1) aspect = 0.1;
            if (aspect > 10) aspect = 10;

            if (tw / th > aspect)
            {
                w = (int)(tw);
                h = (int)(w / aspect);
            }
            else
            {
                h = (int)(th);
                w = (int)(h * aspect);
            }




            Grid grd = new Grid();
            grd.Background = backgroudbrush; //Brushes.Transparent;
            grd.Width = w;
            grd.Height = h;

            grd.Children.Add(txt);

            grd.Measure(new System.Windows.Size(w, h));
            grd.Arrange(new Rect(0, 0, w, h));

            System.Windows.Media.Brush brush = null;
            RenderTargetBitmap renderTarget = new RenderTargetBitmap(w, h, 96, 96, PixelFormats.Pbgra32);
            renderTarget.Render(grd);
            renderTarget.Freeze();
            brush = new ImageBrush(renderTarget);

            MaterialGroup matgroup = new MaterialGroup();
            matgroup.Children.Add(new DiffuseMaterial(brush));
            matgroup.Children.Add(new SpecularMaterial(Brushes.White, 90));


            GeometryModel3D model = new GeometryModel3D(mesh, matgroup);

            return model;

        }

