        /// <summary>
        /// 组合返回平滑边的box和cyl模组
        /// </summary>
        /// <param name="orgtrans">变换</param>
        /// <param name="mat">材质</param>
        /// <param name="meshtop">顶mesh</param>
        /// <param name="meshmid">中部mesh</param>
        /// <returns></returns>
        public static Model3DGroup genBoxCylModelGroup(Transform3D orgtrans, Material mat, MeshGeometry3D meshtop, MeshGeometry3D meshmid)
        {

            //MeshGeometry3D meshtop = genBoxTopMesh();
            //MeshGeometry3D meshmid = genBoxMidMesh();

            //double orgtoplen = meshtop.Bounds.SizeY;
            //double orgmidlen = meshmid.Bounds.SizeY;

            Model3DGroup modelall = new Model3DGroup();
            GeometryModel3D modeltop = new GeometryModel3D(meshtop, mat);
            GeometryModel3D modelmid = new GeometryModel3D(meshmid, mat);
            modelall.Children.Add(modelmid);
            modelall.Children.Add(modeltop);


            Transform3DGroup transtop, transmid;


            if (orgtrans is Transform3DGroup)
            {
                Transform3DGroup orttg = orgtrans as Transform3DGroup;
                ScaleTransform3D storg = new ScaleTransform3D(1, 1, 1);
                for (int i = 0; i < orttg.Children.Count; i++)
                {
                    if (orttg.Children[i] is ScaleTransform3D)
                    {
                        storg = (ScaleTransform3D)orttg.Children[i];
                        orttg.Children.RemoveAt(i);
                        break;
                    }
                }

                calsub(storg, meshtop, meshmid, out transtop, out transmid);

                modeltop.Transform = transtop;
                modelmid.Transform = transmid;
                modelall.Transform = orttg;

            }
            else
            {
                if (orgtrans is ScaleTransform3D)
                {

                    calsub((ScaleTransform3D)orgtrans, meshtop, meshmid, out transtop, out transmid);

                    modeltop.Transform = transtop;
                    modelmid.Transform = transmid;

                }
                else
                {
                    calsub(new ScaleTransform3D(1, 1, 1), meshtop, meshmid, out transtop, out transmid);

                    modeltop.Transform = transtop;
                    modelmid.Transform = transmid;
                    modelall.Transform = orgtrans;
                }
            }


            return modelall;
        }
        private static void calsub(ScaleTransform3D orgtransform, MeshGeometry3D meshtop, MeshGeometry3D meshmid, out Transform3DGroup tgtop, out Transform3DGroup tgmid)
        {
            //以保持顶部宽高比的方式，重新分配scaleY
            double orglen, toplen, midlen;
            double newScaleYTop, newScaleYMid;
            orglen = orgtransform.ScaleY;
            toplen = meshtop.Bounds.SizeY / Math.Max(meshtop.Bounds.SizeX, meshtop.Bounds.SizeZ) * Math.Max(orgtransform.ScaleX, orgtransform.ScaleZ);
            if (orglen < toplen)
                toplen = orglen;
            midlen = orglen - toplen;

            newScaleYTop = toplen / meshtop.Bounds.SizeY;
            newScaleYMid = midlen / meshmid.Bounds.SizeY;

            ScaleTransform3D sttop = new ScaleTransform3D(orgtransform.ScaleX / meshtop.Bounds.SizeX, newScaleYTop, orgtransform.ScaleZ / meshtop.Bounds.SizeZ, -meshtop.Bounds.Location.X * orgtransform.CenterX, meshtop.Bounds.Location.Y, -meshtop.Bounds.Location.Z * orgtransform.CenterZ);
            tgtop = new Transform3DGroup();
            tgtop.Children.Add(sttop);
            double offsety = -meshtop.Bounds.Location.Y + midlen - 1;
            tgtop.Children.Add(new TranslateTransform3D(meshtop.Bounds.Location.X * orgtransform.CenterX + orgtransform.CenterX, offsety, meshtop.Bounds.Location.Z * orgtransform.CenterZ + orgtransform.CenterZ));
            tgmid = new Transform3DGroup();
            ScaleTransform3D stmid = new ScaleTransform3D(orgtransform.ScaleX / meshtop.Bounds.SizeX, newScaleYMid, orgtransform.ScaleZ / meshtop.Bounds.SizeZ, -meshtop.Bounds.Location.X * orgtransform.CenterX, meshmid.Bounds.Y, -meshtop.Bounds.Location.Z * orgtransform.CenterZ);
            tgmid.Children.Add(stmid);
            offsety = -meshmid.Bounds.Y - 1;
            tgmid.Children.Add(new TranslateTransform3D(meshtop.Bounds.Location.X * orgtransform.CenterX + orgtransform.CenterX, offsety, meshtop.Bounds.Location.Z * orgtransform.CenterZ + orgtransform.CenterZ));

        }



