        #region 电厂模型
        /// <summary>
        /// 火电厂模型mesh
        /// </summary>
        /// <returns></returns>
        public static MeshGeometry3D genPlantMesh()
        {
            int tDiv = 32;
            int yDiv = 32;
            double maxTheta = DegToRad(360.0);
            double minY = -1.0;
            double maxY = 1.0;

            double dt = maxTheta / tDiv;
            double dy = (maxY - minY) / yDiv;

            MeshGeometry3D mesh = new MeshGeometry3D();

            for (int yi = 0; yi <= yDiv; yi++)
            {
                double y = minY + yi * dy;

                for (int ti = 0; ti <= tDiv; ti++)
                {
                    double t = ti * dt;

                    mesh.Positions.Add(GetPositionPlant(t, y));
                    mesh.Normals.Add(GetNormal(t, y));
                    mesh.TextureCoordinates.Add(GetTextureCoordinate(t, y));
                }
            }

            for (int yi = 0; yi < yDiv; yi++)
            {
                for (int ti = 0; ti < tDiv; ti++)
                {
                    int x0 = ti;
                    int x1 = (ti + 1);
                    int y0 = yi * (tDiv + 1);
                    int y1 = (yi + 1) * (tDiv + 1);

                    mesh.TriangleIndices.Add(x0 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y0);

                    mesh.TriangleIndices.Add(x1 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y1);
                }
            }
            mesh.Positions.Add(new Point3D(0, 1, 0));
            mesh.Normals.Add(new Vector3D(0, 20, 0));
            mesh.TextureCoordinates.Add(GetTextureCoordinate(0, 1));

            for (int ti = 0; ti <= tDiv; ti++)
            {
                double t = ti * dt;

                mesh.Positions.Add(GetPositionPlant(t, 1));
                mesh.Normals.Add(GetNormalPlant(t, 20));
                mesh.TextureCoordinates.Add(GetTextureCoordinate(t, 1));
            }
            for (int ti = 0; ti <= tDiv; ti++)
            {
                int zz = (yDiv + 1) * (tDiv + 1) + 1 + tDiv + 1;
                int x0 = zz + ti + 1;
                int x1 = zz + (ti + 1) + 1;
                mesh.TriangleIndices.Add(zz);
                mesh.TriangleIndices.Add(x1);
                mesh.TriangleIndices.Add(x0);
            }


            mesh.Freeze();
            return mesh;
        }
        internal static Vector3D GetNormalPlant(double t, double y)
        {
            double x = Math.Cos(t);
            double z = Math.Sin(t);

            return new Vector3D(x, y, z);
        }

        internal static Point3D GetPositionPlant(double t, double y)
        {

            double r = 0.2085 * y * y - 0.1067 * y + 0.6941;
            double x = Math.Cos(t) * r;
            double z = Math.Sin(t) * r;

            return new Point3D(x, y, z);
        }

