        #region 折线3D
        /// <summary>
        /// 生成3D折线，可通过传入平滑插点后的集合来得到平滑3D曲线
        /// </summary>
        /// <param name="ps"></param>
        /// <param name="devc"></param>
        /// <param name="thickness"></param>
        /// <returns></returns>
        public static MeshGeometry3D genCurve3DMesh(Point3D[] ps, int devc, double thickness)
        {
            //生成mesh
            MeshGeometry3D mesh = new MeshGeometry3D();

            double maxTheta = DegToRad(360.0);
            double dt = maxTheta / devc;
            for (int yi = 0; yi < ps.Length; yi++)
            {
                for (int ti = 0; ti <= devc; ti++)
                {
                    double t = ti * dt;

                    Matrix3D matrix = new Matrix3D();
                    matrix.Translate((Vector3D)ps[yi]);
                    Vector3D v0, v1, v2 = new Vector3D(0, 0, 0), vaxis;
                    double ang2; double radscale;
                    v0 = new Vector3D(0, 1, 0);
                    if (yi == 0)
                    {
                        v1 = ps[yi + 1] - ps[yi];
                        radscale = 1;
                    }
                    else if (yi == ps.Length - 1)
                    {
                        v1 = ps[yi] - ps[yi - 1];
                        radscale = 1;
                    }
                    else
                    {
                        v1 = ps[yi] - ps[yi - 1];
                        v2 = ps[yi + 1] - ps[yi];
                        ang2 = 180 - Vector3D.AngleBetween(v1, v2);
                        if (ang2 == 0)
                            radscale = 1;
                        else
                            radscale = 1.0 / Math.Sin(ang2 / 2 / 180 * Math.PI);
                    }
                    //园平面旋转
                    vaxis = Vector3D.CrossProduct(v0, v1);
                    double ang = Vector3D.AngleBetween(v0, v1);
                    Quaternion q = new Quaternion(vaxis, ang);
                    matrix.RotateAt(q, ps[yi]);
                    //交线旋转
                    if (radscale > 1)
                    {
                        vaxis = Vector3D.CrossProduct(v1, v2);
                        ang = Vector3D.AngleBetween(v1, v2) / 2;
                        q = new Quaternion(vaxis, ang);
                        matrix.RotateAt(q, ps[yi]);
                    }




                    mesh.Positions.Add(GetPositionCurve(t, thickness, matrix, radscale));
                    mesh.Normals.Add(GetNormalCurve(t, matrix));
                    //mesh.TextureCoordinates.Add(GetTextureCoordinate(t, y));
                }
            }

            for (int yi = 0; yi < ps.Length; yi++)
            {
                for (int ti = 0; ti < devc; ti++)
                {
                    int x0 = ti;
                    int x1 = (ti + 1);
                    int y0 = yi * (devc + 1);
                    int y1 = (yi + 1) * (devc + 1);

                    mesh.TriangleIndices.Add(x0 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y0);

                    mesh.TriangleIndices.Add(x1 + y0);
                    mesh.TriangleIndices.Add(x0 + y1);
                    mesh.TriangleIndices.Add(x1 + y1);
                }
            }

            mesh.Freeze();



            return mesh;
        }

        internal static Point3D GetPositionCurve(double t, double thickness, Matrix3D matrix, double radscale)
        {
            //计算椭圆截面

            double x = thickness * radscale * Math.Cos(t);
            double y = 0;
            double z = thickness * Math.Sin(t);

            Point3D pp = new Point3D(x, y, z);

            return matrix.Transform(pp);
        }

        internal static Vector3D GetNormalCurve(double t, Matrix3D matrix)
        {
            double x = Math.Cos(t);
            double z = Math.Sin(t);

            return matrix.Transform(new Vector3D(x, 0, z));
        }


        internal static Point GetTextureCoordinateCurve(double t, double y)
        {
            Matrix m = new Matrix();
            m.Scale(1 / (2 * Math.PI), -0.5);

            Point p = new Point(t, y);
            p = p * m;

            return p;
        }
