        #region 工具
        /// <summary>
        /// 合并多个mesh为单个mesh
        /// </summary>
        /// <param name="mg">mesh系列</param>
        /// <returns></returns>
        public static MeshGeometry3D mergeMesh(List<MeshGeometry3D> mg) //合并mesh组
        {
            MeshGeometry3D mesh = new MeshGeometry3D();
            Point3DCollection points = new Point3DCollection();
            Vector3DCollection normals = new Vector3DCollection();
            PointCollection texts = new PointCollection();
            Int32Collection tris = new Int32Collection();
            Int32Collection tmp;
            Int32 baseidx;
            foreach (MeshGeometry3D oldmesh in mg)
            {
                baseidx = points.Count;
                points = new Point3DCollection(points.Concat(oldmesh.Positions));
                normals = new Vector3DCollection(normals.Concat(oldmesh.Normals));
                texts = new PointCollection(texts.Concat(oldmesh.TextureCoordinates));
                //tmp = oldmesh.TriangleIndices;
                tmp = oldmesh.Clone().TriangleIndices;
                for (int i = 0; i < tmp.Count; i++)
                {
                    tmp[i] += baseidx;
                }
                tris = new Int32Collection(tris.Concat(tmp));
            }
            mesh.Positions = points;
            mesh.Normals = normals;
            mesh.TextureCoordinates = texts;
            mesh.TriangleIndices = tris;
            return mesh;
        }

        /// <summary>
        /// 为3D场景加一个巨大的box包含所有模型, 以接收在整个viewport3d范围的操作输入
        /// </summary>
        /// <param name="myViewport3D">场景对象</param>
        /// /// <param name="scale">倍数</param>
        public static void addControlCube(Viewport3D myViewport3D, double scale)
        {
            Material mat = new DiffuseMaterial(Brushes.Transparent);
            MeshGeometry3D mesh = (MeshGeometry3D)myViewport3D.FindResource("meshCube");
            GeometryModel3D model = new GeometryModel3D(mesh, mat);
            model.BackMaterial = mat;
            model.Transform = new ScaleTransform3D(scale / 2, scale / 2, scale / 2);
            ModelVisual3D mv3d = new ModelVisual3D();
            mv3d.Content = model;
            myViewport3D.Children.Add(mv3d);
        }

        /// <summary>
        /// 求面与线的交点
        /// </summary>
        /// <param name="vflat">面的法向量</param>
        /// <param name="pflat">面上的一点</param>
        /// <param name="vline">线的向量</param>
        /// <param name="pline">线上一点</param>
        /// <returns>平行，或线在面上，返回null</returns>
        public static Nullable<Point3D> calFlatXLine(Vector3D vflat, Point3D pflat, Vector3D vline, Point3D pline)
        {
            Nullable<Point3D> result = null;
            /*
            设    Pt = P1 + t(P2 ‐P1)；现在求取参数t的大小；
 
       因为Pt也是平面上的顶点，则矢量Pt Pon与法向量的点乘为0，可列方程：
 
                             (Pt ‐Pon) • N = 0；
 
                             (P1 ‐Pon)• N + t(P2 ‐P1)• N = 0；
 
                             则 t = ‐(P1 ‐Pon)• N /(P2 ‐P1)• N；
 */
            double t;
            vline.Normalize();
            Point3D p2 = pline;
            Point3D p1 = p2 + vline;
            if (Vector3D.DotProduct((p1 - pflat), vflat) != 0 && Vector3D.DotProduct((p2 - p1), vflat) != 0) //不平行，不在面上
            {
                t = -Vector3D.DotProduct((p1 - pflat), vflat) / Vector3D.DotProduct((p2 - p1), vflat);
                result = p1 + t * (p2 - p1);
            }

            return result;
        }
        #endregion



